import {
  SideBar,
  ChannelBar,
  ContentContainer,
  TopNavigation,
} from './components';

function App() {
  return (
    <div className='flex'>
      <SideBar />
      <ChannelBar />
      <TopNavigation className='content-container' />
      <ContentContainer />
    </div>
  );
}

export default App;
